import React from 'react';

const Order = (props) => {
let orders;
let title;
console.log(props.orderList)
  if ( props.orderList.length === 0 ){
    title =( 
        <h6> PLEASE TAP ON THE CREATE ORDER BUTTON TO START A NEW ORDER</h6>
        );
     orders=(
        <h4 className="empty_list">YOU HAVE NO ORDER LIST </h4>
    )
  }else {
      title =( 
            <div className="headings">
                <p className="order_id">ORDER ID</p>
                <p className="receiver_name">RECEIVERS NAME</p>
                <p className="receiver_phone_no">RECEIVERS PHONE NO</p>
                <p className="pickup_address">PICKUP ADDRESS</p>
                <p className="destination_address">DESTINATION ADDRESS</p>
                <p className="order_date">ORDER DATE</p>
                <p className="status">STATUS</p>
                <p className="c_location">CURRENT LOCATION</p>

            </div>
      );
     orders =props.orderList.map((order)=>{
        return (
            <div className="headings" key={order.order_id}> 
                <p className="order_id">{order.order_id}</p>
                <p className="receiver_name">{order.receiver_name}</p>
                <p className="receiver_phone_no">{order.receiver_phone_no}</p>
                <p className="pickup_address">{order.pickup_address}</p>
                <p className="destination_address">{order.destination_address}</p>
                <p className="order_date">{order.order_date.split('T')[0]}</p>
                <p className="status">{order.status}</p>
                <p className="c_location">{order.c_location}</p>


            </div>

        )}
        )
  }




    return (
        <div>
            {title}
           {orders} 
        </div>
    );
}

export default Order;
